insert into term (code,name,parent,scope) values ('1','Categories',NULL,'Thematic terms for categorizing information resources.  This thesaurus is intended to support finding and understanding scientific information.');
insert into term (code,name,parent,scope) values ('6','acid deposition','66','The process by which emissions, chiefly sulfur and nitrogen compounds, either react with the atmosphere when deposited on earth by precipitation of snow, rain, or fog with a pH of 5.5 or below, or settle out as acidic particles or gases.');
insert into term (code,name,parent,scope) values ('12','administrative and political boundaries','223','Lines drawn on maps or described in documents which encompass territory controlled by a government or organizational unit that may or may not align with geographic or cultural barriers. Use for datasets containing boundary representations for political/administrative units and related information.');
insert into term (code,name,parent,scope) values ('15','aerial photography','981','The process of taking pictures with a camera from an aircraft. Use for both the process of photography from the air and the images produced by the process.');
insert into term (code,name,parent,scope) values ('18','aeromagnetic surveying','981','Mapping of the earth''s magnetic field with the use of airborne electronic magnetometers.');
insert into term (code,name,parent,scope) values ('19','aeroradiometric surveying','981','Mapping of gamma radiation from the earth''s surface with airborne scintillation meters or gamma-ray spectrometers.');
insert into term (code,name,parent,scope) values ('24','agriculture','1174','The science and business of soil cultivation to raise crops and of animal husbandry to raise domesticated animals.');
insert into term (code,name,parent,scope) values ('27','air temperature','67',NULL);
insert into term (code,name,parent,scope) values ('29','algae','843','Chlorophyll-bearing primarily aquatic nonvascular species that have no true roots, stems, or leaves; most algae are microscopic, but some species can be as large as vascular plants.');
insert into term (code,name,parent,scope) values ('30','algal blooms','310','Exceptional growth of algae and cyanobacteria in lakes, rivers or oceans due to excessive nutrients or climatic conditions.');
insert into term (code,name,parent,scope) values ('36','altimetry measurement','450','The measurement of altitude, or height above mean sea level, using instruments such as aneroid barometers and radar altimeters.');
insert into term (code,name,parent,scope) values ('37','amphibians','1269','Vertebrates of the class Amphibia including frogs and toads (Anura), salamanders (Urodela), caecilians (Apoda) and extinct forms which are cold-blooded and have life stages in water as eggs and larval forms (tadpoles)until they metamorphose as adults.');
insert into term (code,name,parent,scope) values ('39','anatomy and physiology','650','Study of the body structures (anatomy) and life functions and activities (physiology)of plants and animals.');
insert into term (code,name,parent,scope) values ('40','animal behavior','921','The way animals act or react to conditions in the environment and to other organisms, including life patterns such as migration, hibernation, and nocturnal living.');
insert into term (code,name,parent,scope) values ('44','animal tracking','379','Method of studying wildlife by following physical materials (spoor, footprints, droppings, scent) or remote monitoring of individuals or populations in an area to document the presence and movements of the animals and their interactions within the landscape.');
insert into term (code,name,parent,scope) values ('45','animals','843','Multi-celled organisms of the kingdom Animalia with eukaryotic cells (cells with distinct nuclei containing genetic material and bounded by thin membranes) that are heterotrophic (obtaining energy from organic substances produced by other organisms).');
insert into term (code,name,parent,scope) values ('52','aquaculture','24','The farming of organisms that live in water, such as fish, shellfish, and algae for human use.');
insert into term (code,name,parent,scope) values ('53','aquatic biology','650','The scientific study of organisms living in or near water.  This term is to be used for the science of ''aquatic biology'' and for  biological studies in fresh and brackish water. For marine biological studies, use ''marine biology''.');
insert into term (code,name,parent,scope) values ('54','aquatic ecosystems','319','Communities of interdependent organisms living primarily in or on water.');
insert into term (code,name,parent,scope) values ('55','arachnids','58','Carnivorous arthropods, chiefly terrestrial, of the class Arachnida including spiders, scorpions, mites, ticks, false scorpions, palpigrades, solifugids, and harvestmen.');
insert into term (code,name,parent,scope) values ('56','archaea','843','Microscopic organisms of the domain Archaea living on a diet of hydrogen and carbon dioxide, once thought to be bacteria, and often inhabiting extreme environments, such as thermal vents and hot springs, extremely alkaline and acidic waters, hypersaline water, and anoxic habitats.');
insert into term (code,name,parent,scope) values ('58','arthropods','606','Invertebrates belonging to the largest phylum of animals, Arthropoda, with an exoskeleton, segmented bodies, and jointed appendages, including many subphyla and classes, such as insects, crustaceans, horseshoe crabs, sea spiders, centipedes, millipedes, and the extinct trilobites.');
insert into term (code,name,parent,scope) values ('61','asthenosphere','690','A layer of the earth within the upper mantle and directly below the lithosphere. This layer has a semi-solid consistency that reaches to about 200 kilometers (124 miles) below the surface.');
insert into term (code,name,parent,scope) values ('63','atmospheric and climatic processes','101','Phenomena affecting or occurring within the mass of gases that surrounds the earth, including its physics, chemistry, dynamics, and weather conditions.');
insert into term (code,name,parent,scope) values ('64','atmospheric circulation','63','Movement of atmospheric gases around the earth.');
insert into term (code,name,parent,scope) values ('65','atmospheric composition','67','Components of the mass of gases that surrounds a planet.  The earth''s atmosphere consists of nitrogen, oxygen, and small portions of other gases.');
insert into term (code,name,parent,scope) values ('66','atmospheric deposition (chemical & particulate)','63','The transfer of substances from the air to the surface of the earth, either in wet form (rain, fog, snow, dew, frost, hail) or in dry form (gases, aerosols, particles).');
insert into term (code,name,parent,scope) values ('67','atmospheric properties','287','Characteristics of the mass of gases surrounding the earth  such as composition, temperature, pressure, and humidity.');
