insert into term (code,name,parent,scope) values ('74','AVHRR','588','Advanced Very High Resolution Radiometer or broad-band, four or five channel scanner, sensing in the visible, near-infrared, and thermal infrared portions of the electromagnetic spectrum. This information is used to estimate characteristics of the land and sea surface such as temperature and overall health of vegetation.');
insert into term (code,name,parent,scope) values ('76','bacteria','843','Single celled microorganisms, beneficial or pathogenic, without a nuclear membrane.');
