insert into term (code,name,parent,scope) values ('130','bryozoans and brachiopods','606','Aquatic invertebrates, usually marine, belonging to the phyla Bryozoa and Brachiopoda.  Brachiopods, or clam shells, are solitary living invertebrates characterized by two shells and a lophophore, which is a complex food gathering organ.  Bryozoans are colonial and include moss coral and moss polyps.');
