insert into term (code,name,parent,scope) values ('135','butterflies and moths','591','Insects of the order Lepidoptera that have four wings with overlapping, often highly colored scales. They undergo four life cycle stages: eggs, caterpillar larvae, pupae, and the winged adults.');
