insert into term (code,name,parent,scope) values ('334','endocrinology','39','Study of the collection of ductless glands that secrete hormones which influence growth, gender, sexual maturity, and other attributes.');
insert into term (code,name,parent,scope) values ('337','engineering geology','339','Branch of geology involved in the application of soil and rock mechanics, natural hazards, and other geological studies to the practice of engineering and construction.');
insert into term (code,name,parent,scope) values ('339','engineering sciences','1019','Sciences involved in the application of scientific and mathematical principles to construction, machinery, mechanical design, mining and manufacturing processes and other practical activities.');
insert into term (code,name,parent,scope) values ('341','entomology','605','Branch of zoology involved in studying insects.');
