insert into term (code,name,parent,scope) values ('1195','tsunamis','822','Sea waves generated by submarine earthquakes, volcanic eruptions, or landslides, which are generally imperceptible in deep water but may be very destructive when striking the shoreline.');
insert into term (code,name,parent,scope) values ('1196','tundra ecosystems','1156','Biological communities and habitats located in the treeless plains of Arctic regions where the subsoil is permanently frozen.');
