insert into term (code,name,parent,scope) values ('1203','uranium-thorium analysis','954','Radiometric dating technique used to determine the age of earth materials based on determining the ratio of uranium-238 to the decay product thorium-230. The ratio is compared to the known half-life of the uranium isotope.');
