insert into term (code,name,parent,scope) values ('1267','vertebrate paleontology','861','Branch of paleontology dealing with fossil animals that have spinal columns.');
insert into term (code,name,parent,scope) values ('1268','vertebrate zoology','1339','Branch of zoology that deals with animals that have spinal columns.');
insert into term (code,name,parent,scope) values ('1269','vertebrates','45','Animals possessing a vertebral column or backbone including birds, fishes, amphibians, reptiles, and mammals.');
insert into term (code,name,parent,scope) values ('1273','video monitoring','375','Field study employing the use of filming or repeated photography with stationary optical or digital cameras to observe changes in a feature or organism.');
