insert into term (code,name,parent,scope) values ('2063','augering','281','Use of a device with rotating blades and possibly helical flanges to dig holes in unconsolidated material for subsurface sampling.');
insert into term (code,name,parent,scope) values ('2064','push coring','281','Use of a small, hand-held tube pressed into unconsolidated material for sampling.');
insert into term (code,name,parent,scope) values ('2065','rotary drilling','281','Use of machinery to drive a rotating bit through earth materials in order to sample below the surface.');
insert into term (code,name,parent,scope) values ('2066','vibracoring','281','Application of vibration to a coring device in order to achieve greater penetration for sampling unconsolidated material.');
insert into term (code,name,parent,scope) values ('2067','grab sampling','379','Use of a mechanical device to seize a volume of unconsolidated surficial material for study.  This term applies when the device used is specifically crafted for grab sampling.');
insert into term (code,name,parent,scope) values ('2068','tidal currents','1799','Currents caused by tidal changes in water level from one body of water to another.');
insert into term (code,name,parent,scope) values ('2069','barrier island migration','1799','The slow, landward movement of barrier islands in response to sea level rise and repeated storm washover.');
insert into term (code,name,parent,scope) values ('2070','coastal emergence','1799','Relative uplift of the coast accompanied by seaward displacement of the shoreline.');
insert into term (code,name,parent,scope) values ('2071','coastal submergence','1799','Relative subsidence of the coast accompanied by landward displacement of the shoreline.');
insert into term (code,name,parent,scope) values ('2072','shoreline accretion','1799','Seaward migration of the shoreline resulting from the addition of earth materials.');
insert into term (code,name,parent,scope) values ('2073','mitigation of coastal hazards','689','Actions taken to reduce risk of physical disruption in coastal environments.');
insert into term (code,name,parent,scope) values ('2074','hard shoreline stabilization','2073','Use of engineered structures to armor or otherwise protect the shoreline against erosional agents such as waves and currents.  Includes breakwaters, bulkheads, seawalls, groins, jetties, and revetments.');
insert into term (code,name,parent,scope) values ('2075','soft shoreline stabilization','2073','Mitigating coastal erosion by managing the sediment budget (for example, beach nourishment or sand bypassing) or restoring dunes and wetlands (for example, by planting erosion-resistant vegetation).');
insert into term (code,name,parent,scope) values ('2076','coastal infrastructure relocation','2073','Landward relocation of infrastructure to reduce the risk from coastal hazards.');
insert into term (code,name,parent,scope) values ('2077','field activity logs','808','Operational records for observation, inventory, sampling, or monitoring activities.');
insert into term (code,name,parent,scope) values ('2078','navigational data','474','Geospatial data indicating the locations of instruments, vessels, aircraft, or other vehicles used to collect scientific observations.  These data include horizontal coordinates in sequence, and may include time or vertical position.');
insert into term (code,name,parent,scope) values ('2079','scientific interpretation','734','Application of scientific judgment as to the meaning of observations or models. Use for interpretations that are provided in formats similar to data, such as geospatial data.');
insert into term (code,name,parent,scope) values ('2080','sound velocity','1304','Estimates of the velocity of sound in water, indexed by depth at a specific location, usually calculated from other water properties.');
insert into term (code,name,parent,scope) values ('2081','profiles','235','Observations or calculations given for a series of depths, at or near the same horizontal position.');
insert into term (code,name,parent,scope) values ('2082','subsampling','619','Preparation of study materials by dividing or slicing cores, samples, or other collected materials.');
insert into term (code,name,parent,scope) values ('2083','LORAN-C navigation','450','Hyperbolic radio navigation system used for near-shore waters.');
insert into term (code,name,parent,scope) values ('2084','ground penetrating radar','326','Electromagnetic imaging instrument using radar to investigate shallow subsurface structure.');
insert into term (code,name,parent,scope) values ('2085','magnetotelluric surveying','326','Passive geophysical technique that uses the earth''s natural electromagnetic field to investigate the spatial variation of electrical resistivity in the subsurface.');
insert into term (code,name,parent,scope) values ('2086','continuous resistivity profiling','326','Ship-based method of analyzing apparent resistivity of the sub-bottom (for example, spatial variation in pore-water salinity) by measuring the induced electromagnetic response to a current generated by the instruments.');
insert into term (code,name,parent,scope) values ('2087','electrical resistivity imaging','326','Land-based resistivity survey where current is applied to the ground using an array of electrodes and apparent resistivity of the subsurface is measured, giving estimates of the spatial variability of resistivity (for example, variations in pore water salinity).');
insert into term (code,name,parent,scope) values ('2088','laboratory experiments','619','Procedures carried out in a laboratory under controlled conditions to test specific scientific hypotheses.');
insert into term (code,name,parent,scope) values ('2089','stratigraphic thickness','1103','Thickness of earth material layers or groups of such layers, often portrayed as isopachs (contours) or gridded data.');
insert into term (code,name,parent,scope) values ('2090','lakebed characteristics','287','Characteristics of the bottom of inland bodies of water.');
insert into term (code,name,parent,scope) values ('2091','lakebed acoustic reflectivity','2090','Acoustic energy received by a sonar system, providing a measure of the roughness of the lakebed.');
insert into term (code,name,parent,scope) values ('2092','contouring','1085','Derivation of contours, or other lines of constant value, that visually summarize the spatial variation of some characteristic over an area, for example elevation.');
insert into term (code,name,parent,scope) values ('2093','study areas','474','Geospatial data describing the areas from which samples were taken or observations were made, typically polygonal.  May be approximate, as in bounding coordinates, or precise.');
insert into term (code,name,parent,scope) values ('2094','critical minerals','745','A non-fuel mineral or mineral material essential to the economic and national security of the US, the supply chain of which is vulnerable to disruption, and that serves an essential function in the manufacturing of a product, the absence of which would have significant consequences for our economy or our national security.');
insert into term (code,name,parent,scope) values ('2261','adaptive management','689','A decision-making process aiming to reduce uncertainty through system monitoring and feedback, used for environmental or resource management.');
insert into term (code,name,parent,scope) values ('2263','platinum-group elements','1426','A group of chemically similar metal elements that tend to occur in the same types of mineral deposits.');
insert into term (code,name,parent,scope) values ('2264','water column reflectivity','1304','A measure of the strength of reflection from small particles suspended in water. It is usually measured by sending a pulse of sound or light through the water and measuring the sound or light that is returned. Water column reflectivity can be used to measure the concentration of suspended particles.');
insert into term (code,name,parent,scope) values ('2265','structure from motion','574','Mathematical analysis, using photogrammetric principles, of multiple images that depict the same subject from different angles to derive geometrical information and relationships in three-dimensional space that are not inherent in any single image. Often used for deriving land elevation or large scale orthoimagery from a collection of aerial photographs.');
insert into term (code,name,parent,scope) values ('2266','Mesoproterozoic','1656','Era of geologic time approximately 1.6 to 1 billion years ago. https://doi.org/10.3133/fs20103059');
insert into term (code,name,parent,scope) values ('2267','Paleoproterozoic','1656','Era of geologic time approximately 2.5 to 1.6 billion years ago. https://doi.org/10.3133/fs20103059');
insert into term (code,name,parent,scope) values ('2268','biological soil crusts','1080','Communities commonly found on the soil surface in arid and semi-arid ecosystems, these consist of mosses, cyanobacteria, lichens, algae, and microfungi, which weave together and adhere to the soil to form a matrix that lessens erosion, supports nitrogen fixation, and retains moisture. These organisms are important to the functioning of ecosystems and to the organization of plant and soil communities.');
insert into term (code,name,parent,scope) values ('2269','microplastic contamination','769','Plastic particles less than 5 millimeters in diameter that come from a wide variety of sources, found in a variety of forms, including fibers, pellets/beads, foams, films, fragments, and tire particles, and reach aquatic environments through diverse pathways.');
insert into term (code,name,parent,scope) values ('2270','produced water','1723','Water produced during generation and development of energy resources, particularly hydrocarbons, as well as related fluids injected into reservoirs for energy development and associated waste disposal.');
insert into term (code,name,parent,scope) values ('2271','solid industrial waste material','1199','Waste solid materials produced by industrial processing of earth materials, not simply material extracted in the search for ores.');
insert into term (code,name,parent,scope) values ('2272','slag','2271','Solid waste material produced by the industrial processing of ore materials.');
insert into term (code,name,parent,scope) values ('2273','coal ash','2271','Solid waste material remaining from the burning of coal.');
insert into term (code,name,parent,scope) values ('2274','PFAS','769','Per- and polyfluoroalkyl substances (PFAS) are a group of man-made chemical compounds that are an emerging contaminant.');
insert into term (code,name,parent,scope) values ('2275','acid-base accounting','189','An analytical procedure that provides values to help assess the acid-producing and acid-neutralizing potential of overburden rocks prior to coal mining and other large-scale excavations.');
insert into term (code,name,parent,scope) values ('2276','acid neutralizing potential','1367','Geochemical capacity of earth materials to affect the pH of waters flowing through them.');
insert into term (code,name,parent,scope) values ('2277','carbon flux','310','The rate and amount of carbon exchanged between the oceans, atmosphere, land, and living things.');
insert into term (code,name,parent,scope) values ('2278','environmental proxies','734','Biological, chemical, or physical features whose presence, characteristics, or behavior reflect environmental parameters of interest that cannot be readily or efficiently observed or measured directly.');
insert into term (code,name,parent,scope) values ('2279','thermal maturation','435','Chemical alteration of organic material within sediments and sedimentary rocks as a result of heat. Measures of thermal maturation indicate the extent of transformation of detrital organic material into coal and petroleum.');
insert into term (code,name,parent,scope) values ('2280','protected areas','12','Terrestrial and marine areas that are designated and managed for the preservation of biological diversity or other natural, recreational, or cultural uses.');
insert into term (code,name,parent,scope) values ('2281','ecosystem resilience','310','Measure of the persistence of systems and of their ability to absorb change and disturbance and still maintain the same relationships between populations or state variables. (Holling, 1973)');
insert into term (code,name,parent,scope) values ('2282','fluid migration','451','Movement or migration of fluids, including petroleum and other chemicals through earth materials by natural or anthropogenic forces.');
insert into term (code,name,parent,scope) values ('2283','induced seismicity','299','Seismic activity such as earthquakes and tremors of low magnitude resulting from human activity that altered crustal stresses and strains on local faults and fractures.');
insert into term (code,name,parent,scope) values ('2284','ground failure','299','Any consequences of shaking, including liquefaction, landslide, and lateral spread, that affects the stability of the ground.');
insert into term (code,name,parent,scope) values ('2285','modeling','734','Human-constructed representation of processes, phenomena, or objects so that the behaviors, characteristics and relationships among things that are being studied can be understood without exhaustive data collection and analysis.');
insert into term (code,name,parent,scope) values ('2286','conceptual modeling','2285','Representation of a system indicating the relationships among concepts, objects, or processes involved in the system, used to help people understand or simulate the system it represents. Often realized using diagrams or generalized schemas.');
insert into term (code,name,parent,scope) values ('2287','physical modeling','2285','Physical arrangement of materials or objects, to enact processes involving them. The system is understood by observing and reporting the resulting arrangement, behavior, and composition of those materials or objects.');
insert into term (code,name,parent,scope) values ('2288','bioenergetics','1347','Processes by which a living organism acquires, produces, utilizes, or transforms energy. ');
insert into term (code,name,parent,scope) values ('2289','state and transition modeling','2286','Modeling of systems such as ecosystems to predict the consequences of natural events and management actions by describing how specified events and actions may change the components and relationships in the system.');
insert into term (code,name,parent,scope) values ('2290','electromagnetic reflectance and emissivity','1367','Effectiveness of an earth material in reflecting or emitting radiation, varying by wavelength.  Measurements are made over the infrared part of the electromagnetic spectrum in a laboratory to compare with remotely-sensed data obtained by airborne or satellite imaging systems.');
insert into term (code,name,parent,scope) values ('2291','gravity gradient','501','Lateral variation of the three-dimensional vector components of gravity, typically measured using airborne sensors.');
insert into term (code,name,parent,scope) values ('2292','energy storage','799','Methods and technologies for holding energy to be recovered at a later time.');
insert into term (code,name,parent,scope) values ('2293','geologic energy storage','2292','Use of subsurface reservoirs to store energy that can be recovered at a later time using thermal [energy], gravity, or stored air or natural gases.');
insert into term (code,name,parent,scope) values ('2294','carbon dioxide storage assessment','773','Estimates of the storage capacity of carbon dioxide in geologic units at depths of 3,000 to 13,000 feet that are capable of maintaining carbon dioxide in a supercritical state.');
insert into term (code,name,parent,scope) values ('2295','hydrocarbon reservoir processes','101','Interactions among groundwater, hydrocarbons, and rock properties of subsurface geological formations, affecting the potential of those formations to form, trap, and permit the passage and extraction of hydrocarbons.');
insert into term (code,name,parent,scope) values ('2296','carbon mineralization','1731','A form of geologic carbon dioxide storage in which it reacts with rocks and minerals to form solid and stable carbonate materials.  Includes mineralization in mafic and ultramafic bedrock, mine tailings, and alkaline industrial wastes at the surface.');
insert into term (code,name,parent,scope) values ('2297','assessment units','2093','Geographic areas for which a valuable resource is estimated.  Frequently defined in two or more dimensions, for example specifying underground formations in a given geographic area.  Functions or services may be estimated in addition to material resources.');
insert into term (code,name,parent,scope) values ('2298','inverse modeling','713','An iterative approach to estimate the form and characteristics of a physical system explained by observations or measurements. Frequently used to determine a subsurface geological structure from measurements of physical properties obtained at or near the earth''s surface.');
insert into term (code,name,parent,scope) values ('2299','biomarkers','317','Biochemical, physiological, morphological, or histopathological characteristics of organisms that signify exposure to contaminants.  Also used for biogeochemical measurements of rocks to detect biological origin.');
insert into term (code,name,parent,scope) values ('2300','habitat suitability indices','317','Numerical values calculated for a given area representing the capacity of a habitat to support a given species, as the ratio of observed habitat conditions to optimum conditions.');
